    false,nt"url": null,nt"notes": "This annual narrative report for Swan River
    National Wildlife Refuge outlines Refuge accomplishments during the 1995 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. Refuge administration is outlined; information about
    personnel is given. Habitat management is also covered; subjects include wetlands,
    forests, grazing, haying, and pest control. The wildlife section of the report discusses
    wildlife diversity, endangered and threatened species, waterfowl, marsh birds and
    waterbirds, shorebirds, raptors, game mammals, and fisheries resources. The public
    uses of the Refuge described in this report include interpretive programs, hunting,
    fishing, and law enforcement. The equipment and facilities section of the report
    provides information about equipment replacement and communication systems",nt"owner_org":
